static char myc;

/***************************************************************************************************************************
 * Use DAVE/2D to print a string onto the mipi lcd.
 *  @param[IN]   d2_device *handle: acquired with d2_opendevice
 *  @param[IN]   d2_point _xs: coordinate of the character on the horizontal line
 *  @param[IN]   d2_point _ys: coordinate of the character on the vertical line
 *  @param[IN]   char * str: the string to be printed on the mipi lcd
 *  @retval      None
 **************************************************************************************************************************/

void print_bg_font_18(d2_device *handle, d2_point _xs, d2_point _ys, char *_str)
{
    st_gimp_bg_font_18_image_t *img = NULL;
    d2_point cur_x = _xs;
    d2_point cur_y = _ys;
    size_t len = strlen(_str);

	for(uint32_t pos = 0; pos < len; pos++)
	{
        myc = (char) *(_str + pos);

		if((uint8_t) myc < 127)
		{
		    img = (st_gimp_bg_font_18_image_t *)&ascii_table_flash[myc];
			if(img != NULL)
			{
				d2_setblitsrc(handle, img->pixel_data, (d2_s32)img->width, (d2_s32)img->width, (d2_s32)img->height, d2_mode_rgb565);

				d2_blitcopy(handle,
						(d2_width) img->width, (d2_width) img->height, // Source width/height
						(d2_blitpos) 0, 0, // Source position
						(d2_width) ((img->width) << 4), (d2_width) ((img->height) << 4), // Destination width/height
						(d2_point)(cur_x << 4), (d2_point)(cur_y << 4),  // Destination position
						d2_tm_filter);

				cur_y += (d2_point)img->height;
			}
		}
	}
}
